import tabs from '../../db.json';
import { nanoid } from 'nanoid';

console.log(tabs);

export const GuitarTabsList = ({ chord }) => {
  return (
    <>
      <div>
        <h1>
          {chord.key}_{chord.suffix}
        </h1>
        <ul>
          {Object.keys(chord).length > 0 &&
            chord.positions.map((position) => {
              return <li key={nanoid()}>{position.midi}</li>;
            })}
        </ul>
      </div>
    </>
  );
};
